/* VCD dumping functions */
MOD_mkSched & mkSched_backing(tSimStateHdl simHdl)
{
  static MOD_mkSched *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkSched(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkSched::dump_VCD_defs()
{
  (mkSched_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkSched::dump_VCD(tVCDDumpType dt)
{
  (mkSched_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkSched_backing(sim_hdl));
}
